function Counter(){
const [count,setCount] = useState(0);
function increment(){
    setCount(prevState => prevState+1);
}

return(
<div className="App">
<button onClick={()=>increment}>Increase Count</button>
<h2>count</h2>
</div>
)
}
export default Counter
